import './header.css';
import React from 'react';
import { SRLWrapper } from "simple-react-lightbox";
import Victoria from './images/victoria.jpg';
import Beyah from './images/beyah.jpg';


class Gallery extends React.Component {
render() {
    return (
        <SRLWrapper>
      <a href={Victoria}>
        <img src={Victoria} height="800px" width="800px" alt="Umbrella" />
      </a>
      <a href={Beyah}>
        <img src={Beyah} height="800px" width="800px" alt="Blue sky" />
      </a>
    </SRLWrapper>






    );
  }
}

export default Gallery;
